{async function NewsApi(){$.ajax({url:"/get-news",type:"GET"}).done((function(e){let l=e.data.articles,n=document.querySelectorAll(".news-list-container"),t="";l=l.slice(0,5);for(let e=0;e<l.length;e++)t+=`<li class="news mb-1">\n        <a href="${l[e].url}" target="_blank">${l[e].title} <i class="fa fa-external-link"></i></a>\n        </li>`;for(let e=0;e<n.length;e++)n[e].innerHTML=t})).fail((function(e){console.log(e)}))}NewsApi()}